let currentUser = null;

// --- HELPER FUNCTIONS ---
function getSubscriptionNumber(examNumber) {
    // Remove first four digits
    return examNumber.substring(4);
}

function findMinScore(university, college, type) {
    const found = minScores.find(s => 
        s.university === university && s.college === college && s.type === type
    );
    return found ? found.score : 'غير متوفر';
}

// --- UI POPULATION FUNCTIONS ---
function populateDashboard() {
    if (!currentUser) return;

    // Main Page
    document.getElementById('main-student-name').innerText = currentUser.name;
    document.getElementById('main-average-100').innerText = `${currentUser.average}/100`;
    document.getElementById('main-average-percent').innerText = `${currentUser.average}%`;

    // Sidebar
    document.getElementById('sidebar-student-name').innerText = currentUser.name;
    document.getElementById('sidebar-subscription-num').innerText = getSubscriptionNumber(currentUser.id);
    
    // Profile Page
    document.getElementById('profile-student-name').innerText = currentUser.name;
    document.getElementById('profile-subscription-num').innerText = getSubscriptionNumber(currentUser.id);
    document.getElementById('profile-total-score').innerText = (currentUser.average * 3).toFixed(3);
}

function populateResultPage() {
    if (!currentUser) return;
    
    document.getElementById('result-university-college').innerText = `${currentUser.university} - ${currentUser.college}`;
    document.getElementById('result-admission-type').innerText = `نوع القبول: ${currentUser.type}`;
    document.getElementById('result-min-score').innerText = findMinScore(currentUser.university, currentUser.college, currentUser.type);
}

// --- PAGE NAVIGATION WITH LOADING ---
function navigateToPage(pageId) {
    const loadingOverlay = document.getElementById('loadingOverlay');
    const pages = document.querySelectorAll('.page');
    
    // Show loading
    loadingOverlay.classList.add('active');
    
    setTimeout(() => {
        pages.forEach(page => page.classList.remove('active'));
        document.getElementById(pageId).classList.add('active');
        
        // Special handling for result page to populate data
        if (pageId === 'resultPage') {
            populateResultPage();
        }

        // Close sidebar if open
        document.getElementById('sidebar').classList.remove('active');
        
        // Hide loading
        loadingOverlay.classList.remove('active');
    }, 800); // Slightly longer delay for a more formal feel
}

// --- Sidebar Toggle ---
function toggleSidebar() {
    const sidebar = document.getElementById('sidebar');
    sidebar.classList.toggle('active');
}

// --- Login Logic ---
function login() {
    const examNumber = document.getElementById('examNumber').value;
    
    if (!examNumber) {
        alert('الرجاء إدخال الرقم الامتحاني');
        return;
    }
    
    currentUser = students.find(s => s.id === examNumber);
    
    if (currentUser) {
        populateDashboard();
        navigateToPage('mainPage');
    } else {
        alert('الرقم الامتحاني غير صحيح أو غير موجود في القائمة');
    }
}

// --- Logout Logic ---
function logout() {
    if (confirm('هل أنت متأكد من تسجيل الخروج؟')) {
        currentUser = null;
        document.getElementById('examNumber').value = '';
        navigateToPage('loginPage');
    }
}

// --- Close sidebar when clicking outside ---
document.addEventListener('click', function(event) {
    const sidebar = document.getElementById('sidebar');
    const menuIcon = document.querySelector('.menu-icon');
    
    if (!sidebar.contains(event.target) && !menuIcon.contains(event.target)) {
        sidebar.classList.remove('active');
    }
});

// --- Allow login with Enter key ---
document.getElementById('examNumber').addEventListener('keypress', function(e) {
    if (e.key === 'Enter') {
        login();
    }
});